import React from 'react';


class CarouselItem extends React.Component {
    render(){
        return  (
          <div className="carousel-item active">
            <a
              href="https://www.wanted.co.kr/wd/22942">
              <img
                  src="https://s3.ap-northeast-2.amazonaws.com/static.wanted.co.kr/homework/001.jpg"
                  className="d-block w-100"
                  alt="..." />
            </a>
            <a className="carousel-control-prev" onClick={prevSlide} role="button" data-slide="prev">
              <span className="carousel-control-prev-icon" aria-hidden="true"><i data-feather="chevron-left"></i></span>
              <span className="sr-only">Previous</span>
            </a>
            <a className="carousel-control-next" onClick={nextSlide} role="button" data-slide="next">
              <span className="carousel-control-next-icon" aria-hidden="true"><i data-feather="chevron-right"></i></span>
              <span className="sr-only">Next</span>
            </a>
          </div>

        );
    }
}

export default CarouselItem;
